description:
Kick Out the Jams

Arts Documentary hosted by Gary Kemp, published by ITV broadcasted as part of ITV Perspectives series in 2014 - English narration


Information
------------------------------

Spandau Ballet's Gary Kemp investigates the modern art world, 25 years after it was rocked on its heels by by the arrival of Hirst, Emin and the other Young British Artists. Better known as a musician and actor, Gary is also an art enthusiast, who argues that it was the rock'n'roll style of the YBAs which made contemporary art relevant and altered the cultural life of Britain. Kemp considers the extent to which the YBAs, with their love of glitz, glamour and outrageous posturing, act more like rock stars. The film also includes interviews with Sam Taylor-Wood, Gavin Turk and Jake Chapman.

